import React from 'react'
import './Opinion.css'
import Estrella from '../../img/estrella.png';

export default function Opinion() {
  return (
    <div class="opinion">
      <p><img className='o-img' src={Estrella} alt='nose'></img>La verdad este chico me laburo piolaaaaaaaaaaaaaaaaaaaaaaaaaaaa</p>
      <p><span>No me gusto</span></p>
      <p><span>Safa</span></p>
    </div>
  )
}
